import React from "react";
import crash from '../image/crash.png';
import roulette from '../image/rullete.jpg';
import raffle from '../image/loterie.webp';

function Home() {
  return (
    
    <div className="home">
      
      <div class="container">
        <div class="row align-items-center my-5">
          <div class=" pagesGame">
          <a href="./Crash"> <img src={crash} alt="Crash" /> </a>
          </div>
          <div class=" pagesGame">
          <a href="./Roulette">
                  <img src={roulette} alt="Roulette" />
          </a>
          </div>
          <div class="col-lg-5 pagesGame">
          <a href="./Raffle">
                  <img src={raffle} alt="Raffle" />
          </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
